INSERT INTO `diarys` VALUES (1,39,'?','\r\n昨日に続き、謎な現象が起きている???\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nなにかというと\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n内容がとっても濃厚なブログを\r\n\r\n\r\n\r\n\r\n\r\nたまには書いてみようかなと\r\n\r\n\r\n\r\n\r\n\r\n気合い入れて書いていたときに\r\n\r\n\r\n\r\n\r\n\r\n\r\nなんと、2回とも途中でバンになり\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n消えてしまったこと??\r\n\r\n\r\n\r\n\r\n\r\nまさか2回連続でなるとはかなしみが深い??\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nということで、\r\n\r\n\r\n\r\n\r\n\r\n途中でバンされるまえに\r\n\r\n\r\n\r\n\r\n\r\n今日は速やかに眠ろうとおもいます??‍♀️??‍♀️\r\n\r\n\r\n\r\n\r\n\r\nでも、とっても書きたい内容だから\r\n\r\n\r\n\r\n\r\n\r\n\r\n明日はPCから投稿してみよう?\r\n','/2020/09/12/20200912_032806','2020-09-12 03:28:06','2020-09-12 03:28:06'),(2,40,'も〜(;_;)きのぉ晴れたから 今日も晴れるかと思いきや…','また雨じゃんね(ノ△Ｔ)\r\n朝方ランドリーに乾燥\r\n持ッてッといて良かッたぁ\r\nそれにしても…結芽が桜まつり\r\nトライしようとする日は\r\nいつも雨ぇ(;_;)そろそろ桜\r\n散らないかなッ\r\n \r\n \r\nとりまえず眠りましょか\r\nおやすみなさい(-^━^-)\r\n \r\nお仕事中の方今日も一日\r\n頑張ッてね(≧∇≦)','/2020/09/12/20200912_033247','2020-09-12 03:32:47','2020-09-12 03:32:47'),(3,22,'昨日朝からまた友達にネイルしてもらった(*^^*)','次は　つけ爪をつけてやってもらいました(*^^*)\r\n\r\nデザインが友達いわくアイスみたいになってると　いわれ２人して爆笑してしまいました(*^^*)\r\n\r\n\r\n\r\nが　しかしもぅ２枚も取れてしまって　かなりショックです(^-^;早すぎだ(^-^;','/2020/09/12/20200912_033529','2020-09-12 03:35:29','2020-09-12 03:35:29'),(4,35,'?Ｈappy happy　Ｖalentine?','皆さんチョコわ貰いましたかー？\r\n \r\n翔子ほんとわ\r\nいつもお世話になってるお客様に\r\n翔子の手作りクッキー作る予定やったけど\r\n月曜日から風邪ひぃてしまって\r\n出勤するのが精一杯になっています( ; _ ; )\r\n \r\n待ってくださってるお客様のこととか考えると\r\n頑張って出勤しよおってなりますよね(つω`*)\r\n \r\n \r\nがらがら声なってるけど\r\n今日も元気に出勤しまーす ','/2020/09/12/20200912_034508','2020-09-12 03:45:08','2020-09-12 03:45:08');
