INSERT INTO `jobs` VALUES (1,1,'時間制(キャバクラ)','レディスタッフ・キャスト','21:00:00',NULL,'時間相談に応じます 1日2～3時間の勤務もOKです','20','30','※初心者大歓迎','土','	勤務日数はおまかせします。','体験入店あり,日払い可,レンタル衣装あり,ノルマなし,未経験者歓迎,各種バックあり,送迎あり,経験者優遇,ドレス・制服貸与あり','浦添エリアの人気店!! 【体験保証時給3,000円】 未経験者大歓迎!在籍中キャストのほとんどが掛け持ちや週1～3出勤など 自分に合ったスタイルで働いております。貴女も是非「体験入店」でお試し下さい! 掛け持ちオッケー(掛け持ちの方も多数在籍してます) 即日体験入店OK、スタッフ専用駐車場完備(30台) お酒飲まなくてもOK(車で出勤して飲まずにお仕事する方も多いですよ!) 送迎もあります!','09097874621','0988786792',NULL,'kaitok0502','2019-08-07 23:56:04','2019-08-10 14:50:33'),(2,2,'ガールズバー','カウンターレディ','20:00:00',NULL,'※時間相談に応じます、３ｈ～の短時間でもOK','18','30','※初心者・学生・主婦・シングルマザー大歓迎',NULL,'週１日～勤務ＯＫ、週末のみでもＯＫ','日払い可,各種バックあり,ノルマなし,送迎あり,未経験者歓迎','楽しく働くならここ！ まだまだオープンしたばかりのガールズバーです♪ 時給１,２００円～１,５００円以上！ 完全日払い制!! 送迎有り（中南部） お友達同士の応募、一日体験もオッケイです♪ 気軽にお問い合わせください♪＼(^o^)／','09068653218','',NULL,'','2019-08-10 15:16:08','2019-08-10 16:29:44'),(3,3,'時間制(キャバクラ)','レディスタッフ・キャスト','21:00:00',NULL,'21:00～LASTまでの間でお好きな時間','18','35','（高校生不可）',NULL,'','体験入店あり,お友達と一緒に面接可,未経験者歓迎,週末のみ可,ノルマなし,レンタル衣装あり,週１から可,大型連休あり,モノレール駅からすぐ,日払い可,送迎あり,給与支給2回,ヘアメイクあり,各種バックあり,経験者優遇,ドレス・制服貸与あり,個人ロッカーあり,友達紹介料あり','初めまして、店長の仁科です。\r\n求人を見ていただきありがとうございます(^^)\r\n少なからずこのホームページを開いたこの瞬間は期待と不安が入り混じっているかと思います！\r\nまた、未経験の方はさらに一歩が踏み出せない、なんてこともありますよね！\r\n僕自身も同じ経験がありますので一歩踏み出す勇気がどれほど大変なのかわかります！\r\nだからこそ一度勇気を出して電話を下さい！\r\nしっかりした対応、サポートをさせていただきますのでどんな小さなことでもお気軽に問い合わせのほうをしてきてください！\r\nお待ちしています(^_^)','0120596307','',NULL,'','0000-00-00 00:00:00','2019-08-25 16:30:11'),(4,4,'時間制(キャバクラ)','レディスタッフ・キャスト','21:00:00',NULL,'','20','30','18歳～30歳位迄　※経験者大歓迎　※未経験者大歓迎',NULL,'','体験入店あり,お友達と一緒に面接可,週末のみ可,週１から可,大型連休あり,日払い可,各種バックあり,友達紹介料あり,未経験者歓迎,ノルマなし,モノレール駅からすぐ,送迎あり,ヘアメイクあり,経験者優遇,ドレス・制服貸与あり,個人ロッカーあり','体験入店時給000円～5000円以上!!\r\n時給3000円～5000円以上!!\r\n＋売上バック10～20%!!ドリンクバック、ボトルバック等、各種高額バック有り!!\r\n新しい豪華な店内でお仕事出来ます♪\r\nお酒が飲めないコでも全然大丈夫だし、未経験のコは自分のペースでゆっくりお仕事していってください!\r\n\r\nキャストさんが働き易い環境作りを準備してお待ちしています。心機一転、一緒にがんばって行きましょう!!\r\nわからない事や不安な事は遠慮なく聞いてくださいね！そして当店では頑張る貴女を応援します。','09097836829','0988617771',NULL,'agarie0823','2019-11-20 23:54:43','2019-11-21 