INSERT INTO `news` VALUES (2,1,'⭐️ナイプラ運営１周年を迎えました⭐️','掲載店舗してくださる店舗様も徐々に増え、無事に運営開始から１年が経ちました！\r\n\r\n\r\nたった２人で立ち上げたこのサービスですが、ここまで来られるとは思っていませんでした。\r\nこれも、地道な営業活動してきた涙ぐましい努力のおかげですし、掲載してくださる店舗様がいるおかげです。\r\n\r\n\r\nこれから、どんどん掲載店舗も増やして行きたいと思っています。\r\n\r\n\r\nこれからも、沖縄県内に特化した男女問わないナイト情報をお届けする事をコンセプトに突き進んで参ります。\r\n\r\n\r\nこれからもどうぞよろしくお願いします??.•*¨*•.¸¸♬??•*¨*•.¸¸♬︎','/2020/11/18/20201118_214456','2020-11-18 21:44:56','2020-11-20 19:27:44'),(3,1,'みなさん、こんばんは?','土曜の夜、どうお過ごしですかぁ⁇\r\n\r\n那覇で飲むのもいいけど、浦添の屋富祖も中々の穴場が見つかるかも知れませんよ〜！\r\nナイプラで浦添エリアを検索してみて下さいね??\r\n\r\nではみなさん、土曜日の夜、楽しんでください??','/2020/11/21/20201121_223630','2020-11-21 22:36:30','2020-11-21 22:38:58'),(4,1,'宜野湾エリア掲載店舗増えました～?','宜野湾市の掲載が少なかったんですけど、掲載してくださる店舗がありましたのでお知らせします！\r\n\r\nナイプラの代表が宮古島出身なんで、宮古島とのつながりあれば、即アポります（笑）\r\n\r\n宜野湾ではっちゃけるなら【ぷうき家】行ってみてくださいね！\r\n<a href=\"https://night-planet.com/ginowan/bar/35\">ぷうき家</a>','/2020/11/23/20201123_204523','2020-11-23 20:45:23','2020-11-23 20:50:22'),(5,1,'那覇のキャバクラ掲載店舗のお知らせ?','美栄橋駅より徒歩1分！\r\n女の子の在籍数は凄いこちらの店舗！\r\n\r\n店内はめちゃくちゃ広いので、平日はもちろん、休日はたくさんの人で賑わいます?\r\n女の子が足りなくなるってことはほとんど無いくらいの在籍数なんで、松山もいいですが、こちらの店舗様は松山よりもリーズナブルな料金ですよ！\r\n\r\n僕が実際に行ったので解ります！\r\nカラオケもあるし、盛り上がる事間違いなしです！\r\n是非、足を運んでみて下さいね〜?','/2020/11/26/20201126_234034','2020-11-26 23:40:34','2020-11-26 23:40:34'),(6,1,'今年も残りわずか?','皆さん❗1年が早く感じませんか??\r\n僕は、歳を重ねる毎に酷くなっていきます?\r\n\r\nしかし、今日も土曜日の夜がやって来ましたね?\r\n\r\n今年はコロナの影響で会社の忘年会等も無くなり、飲み会大好きな僕は残念です?\r\n\r\n来年こそ、コロナの収束を願い、気持ちよく今年を終わらせましょう?\r\n\r\n今日、飲みに出掛けてる方は、なるべく3蜜にならないようお気をつけくださいね?\r\n\r\n写真は、味玉作って、つけ麺を作ってみました(笑)\r\nそれでは楽しんでください〜??\r\n\r\n','/2020/12/05/20201205_190817','2020-12-05 19:08:17','2020-12-05 19:10:43'),(7,1,'?緊急事態宣言明けました！','沖縄は先々週くらいから、緊急事態も明けましたね！\r\n皆さんは飲みに出かけましたか⁇\r\n僕は３日連続飲みに出ました！\r\n密にならないよう極力配慮したけど、飲んでると楽しいもんで三密どころか六密くらいになりましたよ(笑)\r\n冗談です！\r\n宣言明けて、ナイプラでもアクセスが増えて来ました！\r\n皆さん、飲み屋さんが空いてるか気になるようで、ググってるようです?\r\n\r\nナイプラは店舗とインスタが連携してるので、リアルな情報をキャッチします。\r\n\r\n店舗がアクティブな場合は、積極的なインスタ更新をしております。\r\n\r\n是非、店舗のトップページまで、飛んで空き状況を確認してみては⁇画面下のＴＥＬマークで一発ですよ?\r\n\r\n今後ともナイプラをよろしくお願いします?','/2021/03/19/20210319_223008','2021-03-19 22:30:08','2021-03-19 22:30:08'),(8,1,'久しぶりの投稿?','コロナ全然落ち着きませんが、皆さんあまり気にしなくなってるのではないでしょうか❓\r\n感染対策はしっかりしてくださいね?\r\n浦添市屋富祖に新たに２店舗掲載しました！\r\n是非是非行ってみてください?','/2022/06/12/20220612_151841','2022-06-12 15:18:41','2022-06-12 15:18:41');
/*!40000 ALTER TABLE `news` ENABLE KEYS */;
