INSERT INTO `reviews` VALUES (1,30,19,5,4,5,3,3,'楽しかった！','2020-09-03 01:34:54','2020-09-03 01:34:54'),(2,1,19,4,3,3,3,3,'','2020-09-03 01:38:44','2020-09-03 01:38:44'),(3,9,19,5,4,5,4,2,'楽しかった?','2020-09-03 01:39:57','2020-09-03 01:39:57'),(4,18,19,3,3,3,2,5,'','2020-09-03 01:42:05','2020-09-03 01:42:05'),(5,19,19,5,5,5,3,5,'広いし、最高！','2020-09-03 19:24:43','2020-09-03 19:24:43'),(6,24,19,5,5,5,5,5,'めーっちゃリーズナブル！\r\n楽しかったです?⭐️','2020-09-05 10:29:11','2020-09-05 10:29:11'),(7,21,19,5,5,5,5,5,'ガールズBARは滅多に行かないんですが、ここは本当に行って良かった！','2020-09-05 13:12:17','2020-09-05 13:12:17'),(8,5,26,5,5,2,5,3,'女の子もレベルが高くて、聞き上手で楽しかったです！','2020-09-05 18:38:40','2020-09-05 18:38:40'),(9,27,19,5,5,5,5,5,'','2020-09-11 00:55:07','2020-09-11 00:55:07'),(10,23,19,5,5,5,5,5,'楽しかったっす。','2020-09-11 21:42:33','2020-09-11 21:42:33'),(11,34,27,5,5,5,5,5,'初めて行ってきました！\r\nSM玩具があるので、希望があればムチでケツをシバいてくれます?\r\n皆さんも是非??','2020-10-06 18:15:56','2020-10-06 18:15:56'),(12,31,19,5,5,5,5,5,'二次会に知り合いに連れてかれました！\r\n賑やかな雰囲気で、カウンターには女性バーテンダー??が居てダーツも2台あったので、みんなでダーツ勝負?\r\nまた次回行きたいです?','2020-10-06 18:28:47','2020-10-06 18:28:47'),(13,8,19,5,5,5,5,5,'スタッフのノリが最高?\r\nカラオケもあるからテンション爆上がり?\r\n\r\nまた行きますね〜☺️?','2020-10-07 08:12:46','2020-10-07 08:12:46'),(14,20,19,5,5,5,5,5,'友達に呼ばれ、行き着いた場所がここ…。\r\nマスターも気さくな方でカウンター越しで一緒にお酒を飲みました爆笑??\r\n遅い時間まで営業してるので、何処もお店やってないよ！って時にはオススメかと思います！\r\nまた次回、行きたいと思います〜?????','2020-10-31 09:11:27','2020-10-31 09:11:27'),(15,6,19,5,5,5,5,5,'高級感溢れるフロアー…?\r\n女の子もフロアーに見合うような綺麗な女性ばかりでした！また行きますね〜⭐❄️⭐❄️⭐❄⭐❄️⭐❄️️?????????????⭐❄️⭐❄️⭐❄️⭐❄️⭐❄️⭐❄️','2020-10-31 11:45:31','2020-10-31 11:45:31'),(16,25,19,5,5,5,5,5,'過去にテレビで取材も入り、宮古島ではかなり有名店になったはず！\r\n僕の出身が宮古島という事もあり、過去に何度かお店にいったことがあります?\r\n\r\nまず女の子がほとんどﾅｲﾁｬｰでパリピ感ヤバす?はっちゃけるならここかも。','2020-10-31 14:18:07','2020-10-31 14:18:07'),(17,5,19,5,5,5,5,5,'松山キャバ行くならプティー(*^。^*)','2020-10-31 14:29:23','2020-10-31 14:29:23'),(18,2,19,5,5,5,5,5,'また次行きたいお店になったった?','2020-10-31 22:51:45','2020-10-31 22:51:45'),(19,28,19,5,5,5,5,5,'女の子みんな可愛いかったよ〜！\r\nまた、宮古島行った時は行くからね〜??⭐️','2020-11-19 08:25:24','2020-11-19 08:25:24'),(20,35,19,5,5,5,5,5,'僕の出身、宮古島の先輩が経営してる楽しめるBARです！【遊び場】がコンセプトなので、宜野湾ではっちゃけるなら、ココ！?\r\n老若男女いけるはず?','2020-11-23 20:26:17','2020-11-23 20:26:17'),(21,36,19,5,5,5,5,5,'女の子がとにかく多く、そして値段が凄く安いのが特徴ですよ?\r\n複数名で行けば、60分が2,500円なんですよね??\r\n\r\nまたご利用します〜⭐️','2020-11-26 22:44:47','2020-11-26 22:44:47'),(22,14,19,5,5,5,5,5,'楽しかった?','2021-03-01 08:40:40','2021-03-01 08:40:40'),(23,32,19,5,5,5,5,5,'知り合いづてでお店行きました！\r\nダーツとか?あるんで、楽しく呑めるお店だと思う???','2021-05-03 07:09:03','2021-05-03 07:09:03'),(24,26,19,3,3,3,3,3,'','2021-05-03 07:11:40','2021-05-03 07:11:40'),(25,29,19,3,3,3,3,3,'??????','2021-10-01 23:28:16','2021-10-01 23:28:16'),(26,33,19,5,5,5,5,5,'ダーツ好きには持ってこい?','2021-11-28 13:39:43','2021-11-28 13:39:43'),(27,37,19,5,5,5,5,5,'3回くらい飲みに行きました?\r\nアットホームな感じでスタッフさんとお喋り出来ますよ〜?\r\nぜひ、足を運んでみてね〜','2022-06-12 12:18:19','2022-06-12 12:18:19'),(28,38,19,5,5,5,5,5,'裏口から入るって秘密基地感が出ませんか⁇男心をくすぐるよね?\r\n知識が豊富なバーテンダーがお酒を作ってくれて色々勉強にもなりました！','2022-06-12 15:22:41','2022-06-12 15:22:41');
