INSERT INTO `shop_infos` VALUES (1,21,'???お待ちしております〜???','経塚エリア初のガールズBAR\r\n落ち着いてる雰囲気の店内にカラオケやダーツまたさらに\r\nps4までも設置しソフトも充実。(ウイニングイレブン・鉄拳・FPS系・TPS系)\r\nアミューズメントを充実✨','/2020/09/12/20200912_035527','2020-09-12 03:55:27','2020-09-12 03:55:27'),(2,25,'??宮古島の住込み長短リゾートバイト!??','今年の冬は、宮古島で南国生活！\r\n働きながらリゾートライフを満喫!\r\n無料個室寮・ジェットスキー免許取得\r\n航空券全額支給!!\r\n宮古島の人気キャバク：ララウンジ美月で夜はアルバイト、昼は日本一のビーチでアクティブにマリンスポーツやまったりと癒しの時間をお過ごしください。\r\n\r\nお店は地元のお客様も数多く訪れ、お得な情報もGET出来ちゃいます！常時10名以上の女の子が在籍しておりますので夜のお仕事未経験者でも安心のアルバイト。\r\n\r\n個室寮完備・お友達同士OK・半月以上勤務で航空券支給・自動車免許、ジェット免許取得可能・自転車、自動車貸出OK！至れり尽くせりの高待遇で貴女のご来島をお待ちしております。\r\n','/2020/09/12/20200912_035954','2020-09-12 03:59:54','2020-09-12 03:59:54'),(3,26,'??宮古島ってどんなとこ?????‍♀️??‍♂️','沖縄本島から南西へ約300km、北緯24度～25度、東経125度～126度に位置する宮古島。\r\n年々本土から移住される方が増えているとても住みやすい、癒しの島です！\r\n島全体が平坦で、海岸線と白い砂浜、珊瑚礁の海中景観など豊かな自然に恵まれていて、沖縄の海の中でも一番美 しいと言われています。\r\n島の北海域にある国内最大のサンゴ礁群「八重干瀬(やびじ)」は、ダイビング・シュノーケリングポイントとしても有名で、東洋一の白い砂浜「前浜ビーチ」や大人気スポット「伊良部大橋」その他にもたくさんの観光地、景勝地がたくさんありますよ～。\r\nロックフェスティバルやミュージックコンベンションなどの音楽イベントも充実、のんびり過ごしたい方、情熱的に（？）楽しみたい方、素敵なリゾートライフを満喫しましょう！\r\nあと…宮古島にはハブがいませんので安心ですよ～\r\n宮古島の癒されるビーチ','/2020/09/12/20200912_040556','2020-09-12 04:05:56','2020-09-12 04:05:56'),(4,5,'沖縄petit！','休みの日はみんなで海に行ったり?\r\nBBQしたり?\r\n\r\nキャスト 男子従業員 エスコート\r\n大募集中‼️ 県外からのリゾートバイトも募集中です❗️(寮あり)(飛行機代全額負担)\r\n\r\n那覇市松山2-16-16K-1ビル5階\r\ntel 090-7572-5318','/2020/09/12/20200912_041741','2020-09-12 04:17:41','2020-09-12 04:17:41'),(5,34,'1周年際〜?‍♂️??‍♀️','本日より 宮古島、たけし写真館1周年祭‼️ 皆様のおかげ様です！ これから宮古に行き、業者様、メーカーさまに改めて感謝の乾杯させていただきます。','/2020/10/31/20201031_141128','2020-10-31 14:11:28','2020-10-31 14:11:28');
/*!40000 ALTER TABLE `shop_infos` ENABLE KEYS */;
UNLOCK TABLES;

